import React from 'react';


const LastPlayDetail = (data) => {
    const instance = data.props;
    console.log('last play');
    console.log(instance);
    return (
        <div>
            <h1>Last Play</h1>
            <ul>
                <li><p>{instance.clock}</p></li>
                <li><p>{instance.description}</p></li>
            </ul>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/sf0u6TnI3kI" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

            <div>
                <a className="" target="blank" href="https://www.facebook.com/houstonrockets/"><i className="fab fa-facebook-square"></i></a>
                <a className="" target="blank" href="https://www.instagram.com/houstonrockets/?hl=en"><i className="fab fa-instagram-square"></i></a>
                <a className="" target="blank" href="https://twitter.com/HoustonRockets"><i className="fab fa-twitter-square"></i></a>
                <a className="" target="blank" href="https://www.tiktok.com/@houstonrockets?lang=en"><i className="fab fa-tik-tok-square"></i></a>
                <a className="" target="blank" href="https://www.youtube.com/channel/UCVD7l69MVGFq_wzQvbk9HbQ"><i className="fab fa-youtube"></i></a>
            </div>
        </div>
    )
}

export default LastPlayDetail;
